import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Navbar from './componentes/navbar';
import Footer from './componentes/footer';
import Topbar from './componentes/topbar';
import Carrusel from './componentes/carrusel';
import Reserva from './componentes/reserva';
import SobreNosotros from './componentes/sobreNosotros';
import NuestrosServicios from './componentes/nuestrosServicios';
import Caracteristicas from './componentes/caracteristicas';
import Planes from './componentes/planes';
import Colaboradores from './componentes/colaboradores';
import Testimonios from './componentes/testimonios';
import Button from './componentes/button';
import Login from './pages/login';  // Importa tu nuevo componente
import Registro from './pages/registro';
import './App.css';     // Si est치 en el mismo directorio
import './pages/login.css'; // Si est치 en la carpeta 'pages'
import './pages/registro.css'

function App() {
  return (
    <Router>
      <div className="App">
        <Topbar />
        <Navbar />
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/registro" element={<Registro />} />
          </Routes>
        <Carrusel />
        <Reserva />
        <SobreNosotros />
        <NuestrosServicios />
        <Caracteristicas />
        <Planes />
        <Colaboradores/>
        <Testimonios/>   
        <Footer />
        <Button />
      </div>
    </Router>
  );
}

export default App;
